import React from 'react';

/* Component for Main page contents */
const Main = () => {
  return (
    <article>
      <p>Tervetuloa Huutoniemen Hoki -mielikuvitusjääkiekkojoukkueen kotisivulle!</p><br />
      <p>Täältä löydät tietoa joukkueen pelatuista peleistä, harjoituksista, pelaajista ja tilastoista.</p>
    </article>
  );
}

export default Main;
